import React from "react";
import styles from "./carouselSingle.module.css";

const CarouselSingle = ({ restaurant }) => {
  return (
    <div className={styles.singleSlide}>
      <p>{restaurant.Name}</p>
      <p>{restaurant.Price}</p>
    </div>
  );
};

export default CarouselSingle;
